	"sap/suite/ui/generic/template/ListReport/view/fragments/BreakoutActions.fragment.xml":'<core:FragmentDefinition xmlns:template="http://schemas.sap.com/sapui5/extension/sap.ui.core.template/1"\n\t\t\t\t\t\t xmlns="sap.m" xmlns:core="sap.ui.core" xmlns:build="sap.build">\n\n\t<template:if test="{= ${tmpEntitySet>EntitySet} === ${parameter>/entitySet} }">\n\t\t<template:repeat list="{tmpEntitySet>Actions}" var="customaction">\n            <template:if test="{= ${customaction>determining} !== true}">\n\t\t\t\t<Button id="{customaction>id}"\n                        enabled="{path: \'customaction>\', formatter: \'sap.suite.ui.generic.template.js.AnnotationHelper.getBreakoutActionEnabledKey\'}"\n\t\t\t\t\t\ttext="{customaction>text}"\n\t\t\t\t\t\tpress="{customaction>press}" type="Transparent">\n\t\t\t\t\t<layoutData>\n\t\t\t\t\t\t<OverflowToolbarLayoutData\n\t\t\t\t\t\t\t\tmoveToOverflow="{= !(${customaction>importance} === \'com.sap.vocabularies.UI.v1.ImportanceType/High\')}"\n\t\t\t\t\t\t\t\tstayInOverflow="{= ${customaction>importance} === \'com.sap.vocabularies.UI.v1.ImportanceType/Low\'}"/>\n\t\t\t\t\t</layoutData>\n\t\t\t\t</Button>\n            </template:if>\n\t\t</template:repeat>\n\t</template:if>\n</core:FragmentDefinition>',
	"sap/suite/ui/generic/template/ListReport/view/fragments/DeleteConfirmation.fragment.xml":'<core:FragmentDefinition xmlns:template="http://schemas.sap.com/sapui5/extension/sap.ui.core.template/1"\n\t\t\t\t\t\t xmlns="sap.m" xmlns:core="sap.ui.core">\n\t<Dialog id="deleteConfirmationDialog" title="{delete>/text/title}" class="sapUiContentPadding" state="{= ${delete>/lockedItemsCount} !== ${delete>/itemsCount} ? \'Warning\' : \'Error\' }">\n\t\t<content>\n\t\t\t<VBox>\n\t\t\t\t<Text id="deleteText" text="{delete>/text/shortText}"/>\n\t\t\t\t<CheckBox id="deleteCheckBox"\n\t\t\t\t\t\t  selected="{delete>/checkboxSelected}"\n\t\t\t\t\t\t  text="{delete>/text/unsavedChanges}"\n\t\t\t\t\t\t  visible="{= ${delete>/unsavedChangesItemsCount} > 0 &amp;&amp; ${delete>/unsavedChangesItemsCount} !== ${delete>/itemsCount} &amp;&amp; (${delete>/itemsCount} - ${delete>/lockedItemsCount} !== ${delete>/unsavedChangesItemsCount}) ? true : false }"/>\n\t\t\t\t<Text id="undeletableText" text="{delete>/text/undeletableText}"/>\n\t\t\t</VBox>\n\t\t</content>\n\t\t<beginButton>\n\t\t\t<Button text="{i18n>DELETE}" press="onDelete" visible="{= ${delete>/lockedItemsCount} !== ${delete>/itemsCount} }"/>\n\t\t</beginButton>\n\t\t<endButton>\n\t\t\t<Button text="{= ${delete>/lockedItemsCount} !== ${delete>/itemsCount} ? ${i18n>CANCEL} : ${i18n>CLOSE} }" press="onCancel"/>\n\t\t</endButton>\n\t</Dialog>\n</core:FragmentDefinition>\n',
