	"sap/suite/ui/generic/template/fragments/ContactDetails.fragment.xml":'<core:FragmentDefinition xmlns:core="sap.ui.core" xmlns="sap.m" xmlns:build="sap.build">\n\t<QuickView class="sapSmartTemplatesObjectPageContactsQuickView" placement="Auto">\n\t\t<QuickViewPage header="{i18n>CONTACT_INFO}"\n\t\t\t\t\t   icon="{= ${contact>photo} ? ${path: \'contact>photo\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'} : \'sap-icon://person-placeholder\'}"\n\t\t\t\t\t   title="{path: \'contact>fn\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}"\n\t\t\t\t\t   description="{path: \'contact>role\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}">\n\t\t\t<QuickViewGroup heading="{i18n>CONTACT_DETAILS}">\n\n\t\t\t\t<QuickViewGroupElement label="{i18n>CONTACT_JOB_TITLE}" type="text"\n\t\t\t\t\t\t\t\t\t   value="{path: \'contact>title\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}"\n\t\t\t\t\t\t\t\t\t   visible="{= !!${contact>title}}"\n\t\t\t\t\t\t\t\t\t   build:metadata="#pattern:ContactList;prop:value:JobTitle"/>\n\n\t\t\t\t<QuickViewGroupElement label="{i18n>CONTACT_DEPARTMENT}" type="text"\n\t\t\t\t\t\t\t\t\t   value="{path: \'contact>org\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}"\n\t\t\t\t\t\t\t\t\t   visible="{= !!${contact>org}}"\n\t\t\t\t\t\t\t\t\t   build:metadata="#pattern:ContactList;prop:value:Department"/>\n\n\t\t\t\t<QuickViewGroupElement label="{i18n>CONTACT_EMAIL}" type="email"\n\t\t\t\t\t\t\t\t\t   value="{path: \'contact>email/[${type/EnumMember}.indexOf(\\\'ContactInformationType/work\\\')>=0]/address\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}"\n\t\t\t\t\t\t\t\t\t   visible="{= !!${path: \'contact>email/[${type/EnumMember}.indexOf(\\\'ContactInformationType/work\\\')>=0]/address\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'} }"\n\t\t\t\t\t\t\t\t\t   build:metadata="#pattern:ContactList;prop:value:Email:{contact>email/0/address};set:contact>email/0/type/EnumMember:work"/>\n\n\t\t\t\t<QuickViewGroupElement label="{i18n>CONTACT_PHONE}" type="phone"\n\t\t\t\t\t\t\t\t\t   value="{= ${path: \'contact>tel/[${type/EnumMember}.indexOf(\\\'PhoneType/work\\\')>=0]/uri\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}.replace(\'tel:\',\'\') }"\n\t\t\t\t\t\t\t\t\t   visible="{= !!${path: \'contact>tel/[${type/EnumMember}.indexOf(\\\'PhoneType/work\\\')>=0]/uri\'} }"\n\t\t\t\t\t\t\t\t\t   build:metadata="#pattern:ContactList;prop:value:Phone:{contact>tel/0/uri};set:contact>tel/0/type/EnumMember:work"/>\n\n\t\t\t\t<QuickViewGroupElement  label="{i18n>CONTACT_MOBILE}" type="{= (${device>/system/phone} || ${device>/system/tablet})  ? \'mobile\'  : \'phone\' }" \n\t\t\t\t\t\t\t\t\t\tvalue="{= ${path: \'contact>tel/[${type/EnumMember}.indexOf(\\\'PhoneType/cell\\\')>=0]/uri\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}.replace(\'tel:\',\'\') }"\n\t\t\t\t\t\t\t\t\t\tvisible="{= !!${path: \'contact>tel/[${type/EnumMember}.indexOf(\\\'PhoneType/cell\\\')>=0]/uri\'} }"\n\t\t\t\t\t\t\t\t\t\tbuild:metadata="#pattern:ContactList;prop:value:Mobile:{contact>tel/1/uri};set:contact>tel/1/type/EnumMember:cell"/>\n\t\t\t\t\t\t\t\t\t\t\n\t\t\t\t<QuickViewGroupElement label="{i18n>CONTACT_FAX}" type="text"\n\t\t\t\t\t\t\t\t\t   value="{= ${path: \'contact>tel/[${type/EnumMember}.indexOf(\\\'PhoneType/fax\\\')>=0]/uri\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}.replace(\'tel:\',\'\') }"\n\t\t\t\t\t\t\t\t\t   visible="{= !!${path: \'contact>tel/[${type/EnumMember}.indexOf(\\\'PhoneType/fax\\\')>=0]/uri\'} }"\n\t\t\t\t\t\t\t\t\t   build:metadata="#pattern:ContactList;prop:value:Fax:{contact>tel/2/uri};set:contact>tel/2/type/EnumMember:fax"/>\n\n\t\t\t</QuickViewGroup>\n\t\t</QuickViewPage>\n\t</QuickView>\n</core:FragmentDefinition>\n',
	"sap/suite/ui/generic/template/fragments/Contacts.fragment.xml":'<core:FragmentDefinition xmlns:template="http://schemas.sap.com/sapui5/extension/sap.ui.core.template/1"\n\t\t\t\t\t\t xmlns="sap.m" xmlns:build="sap.build" xmlns:core="sap.ui.core" xmlns:layout="sap.ui.layout">\n\t<template:with path="facet>Target" var="target">\n\t\t<template:with path="target>"\n\t\t\t\t\t   helper="sap.ui.model.odata.AnnotationHelper.resolvePath" var="contact">\n\t\t\t<VBox class="sapSmartTemplatesObjectPageContactsListContainer" build:metadata="#ignore">\n\t\t\t\t<layoutData>\n\t\t\t\t\t<layout:GridData id="{path: \'facet>\', formatter: \'sap.suite.ui.generic.template.js.AnnotationHelper.getStableIdPartFromFacet\'}::ContactsList::GridData" span="XL12 L12 M12 S12" />\n\t\t\t\t</layoutData>\n\t\t\t\t<items>\n\t\t\t\t\t<List id="{path: \'facet>\', formatter: \'sap.suite.ui.generic.template.js.AnnotationHelper.getStableIdPartFromFacet\'}::ContactsList"\n\t\t\t\t\t\t  items="{path: \'target>\', formatter: \'sap.ui.model.odata.AnnotationHelper.getNavigationPath\'}"\n\t\t\t\t\t\t  growing="true" growingThreshold="12" class="sapSmartTemplatesObjectPageContactsList"\n\t\t\t\t\t\t  noDataText="{i18n>NOITEMS}"\n\t\t\t\t\t\t  build:metadata="#pattern:ContactList;prop:items:Items;condition:contact>AnnotationType:com.sap.vocabularies.Communication.v1.Contact">\n\t\t\t\t\t\t<CustomListItem class="sapSmartTemplatesObjectPageContactsListItem">\n\t\t\t\t\t\t\t<HBox>\n\t\t\t\t\t\t\t\t<template:if test="{contact>photo}">\n\t\t\t\t\t\t\t\t\t<template:then>\n\t\t\t\t\t\t\t\t\t\t<Image src="{path: \'contact>photo\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}"\n\t\t\t\t\t\t\t\t\t\t\t   width="3rem" height="3rem" densityAware="false" class="sapUiSmallMarginTopBottom"\n\t\t\t\t\t\t\t\t\t\t\t   build:metadata="#pattern:ContactList;prop:src:ImageSource"/>\n\t\t\t\t\t\t\t\t\t</template:then>\n\t\t\t\t\t\t\t\t\t<template:else>\n\t\t\t\t\t\t\t\t\t\t<core:Icon size="2rem"\n\t\t\t\t\t\t\t\t\t\t\t\t   src="person-placeholder"\n\t\t\t\t\t\t\t\t\t\t\t\t   alt=" "\n\t\t\t\t\t\t\t\t\t\t\t\t   class="sapUiSmallMarginTopBottom sapSmartTemplatesObjectPageContactsImage"/>\n\t\t\t\t\t\t\t\t\t</template:else>\n\t\t\t\t\t\t\t\t</template:if>\n\t\t\t\t\t\t\t\t<VBox class="sapUiSmallMarginBegin sapUiSmallMarginTopBottom">\n\t\t\t\t\t\t\t\t\t<Link text="{path: \'contact>fn\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}"\n\t\t\t\t\t\t\t\t\t\t  press="._templateEventHandlers.onContactDetails" class="sapSmartTemplatesObjectPageContactsListContactTitle"\n\t\t\t\t\t\t\t\t\t\t  build:metadata="#pattern:ContactList;prop:text:FullName"/>\n\t\t\t\t\t\t\t\t\t<Text text="{path: \'contact>role\', formatter: \'sap.ui.model.odata.AnnotationHelper.format\'}"\n\t\t\t\t\t\t\t\t\t\t  class="sapSmartTemplatesObjectPageContactsListContactSubTitle"\n\t\t\t\t\t\t\t\t\t\t  build:metadata="#pattern:ContactList;prop:text:Role"/>\n\t\t\t\t\t\t\t\t</VBox>\n\t\t\t\t\t\t\t</HBox>\n\t\t\t\t\t\t</CustomListItem>\n\t\t\t\t\t</List>\n\t\t\t\t\t<core:Fragment fragmentName="sap.suite.ui.generic.template.fragments.ContactDetails" type="XML"/>\n\t\t\t\t</items>\n\t\t\t</VBox>\n\t\t</template:with>\n\t</template:with>\n</core:FragmentDefinition>\n',
	"sap/suite/ui/generic/template/fragments/DataLoss.fragment.xml":'<core:FragmentDefinition xmlns="sap.m"\r\n\txmlns:core="sap.ui.core">\r\n\t<Dialog title="{i18n>WARNING}" state="Warning" type="Message">\r\n\t\t<content>\r\n\t\t\t<Text text="{= (${dataLoss>/mode} === \'LeavePage\') ? ${i18n>DATA_LOSS_MESSAGE} : ${i18n>DATA_LOSS_GENERAL_MESSAGE} }" />\r\n\t\t</content>\r\n\t\t<buttons>\r\n\t\t\t<Button text="{= (${dataLoss>/mode} === \'LeavePage\') ? ${i18n>DATA_LOSS_LEAVE_BTN} : ${i18n>PROCEED} }"\r\n\t\t\t\tpress="onDataLossOK" />\r\n\t\t\t<Button text="{i18n>CANCEL}"\r\n\t\t\t\tpress="onDataLossCancel" />\r\n\t\t</buttons>\r\n\t</Dialog>\r\n</core:FragmentDefinition>',
